import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = ({ setPage }) => {
  return (
    <div style={{ width: '200px', background: '#f2f2f2', height: '100vh', padding: '10px' }}>
      <h4>Menu</h4>
      <ul style={{ listStyle: 'none', paddingLeft: 0 }}>
        <li><button onClick={() => setPage('dashboard')}>Dashboard</button></li>
        <li><button onClick={() => setPage('attendance')}>Attendance</button></li>
        <li><button onClick={() => setPage('material')}>Material</button></li>
        <li><button onClick={() => setPage('learning')}>Learning Outcomes</button></li>
      </ul>
    </div>
  );
};

export default Sidebar;
